  false,\n\t\"url\": null,\n\t\"notes\": \"Seaglider is a buoyancy driven autonomous
  underwater vehicle (AUV) developed by scientists and engineers at the University
  of Washington's School of Oceanography and Applied Physics Laboratory. Seagliders
  are designed to glide from the ocean surface to a programmed depth and back while
  measuring temperature, salinity, depth-averaged current, and other quantities along
  a saw tooth trajectory through the water. Seaglider has entered wide use in scientific
  deployments. They are designed for missions in range of several thousand kilometers
  and durations of many months. Seagliders are commanded remotely and report their
  measurements in near real time via wireless telemetry.\",\n\t\"license_title\":
